import {Button} from 'antd'
import Link from 'next/link'
import Router from 'next/router'

export default () => {
  function gotoTestB() {
    Router.push('/test/b')
  }

  return (
    <>
      <Link href='/a/?id:5'>
        <Button>Index</Button>
      </Link>
      <Button onClick={gotoTestB}>test b</Button>
    </>
  )
}
